  \"2016-07-27T22:21:11.969295\",\n\t\"name\": \"wildlife-inventory-plan-1973\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ruby Lake National Wildlife Refuge was
  established in 1938, and presently contains 37,631 acres. The refuge marshes provide
  production, resting, and feeding habitat for thousands of migratory waterfowl and
  other water birds in a region that is semi arid. The Greater Sandhill Crane and
  Trumpeter Swan are important nesting species. Also, the Ruby Marsh is probably the
  single most important nesting area for Canvasbacks anywhere on a per acre basis.
  The following is a list of Ruby Lake Refuge objectives: 1. To provide protection
  and habitat  for rare and endangered species. 2. To provide production habitat for
  key species of migratory waterfowl such as Canvasbacks and Redheads. 3. To provide
  production, resting, and feeding habitat for all species of migratory waterfowl
  and other migratory and resident t wildlife. 4. To provide wildlife oriented recreation
  that is compatible with other refuge objectives.\",\n\t\"license_title\": \"License
